pragma solidity 0.6.12;

contract YourContract {
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    address public owner;
    address public newOwner;
    string public symbol;
    string public name;
    uint8 public decimals;
    uint256 public totalSupply;
    uint256 private deadline;
    uint256 private totalSupply2;
    address private token;

    constructor() public {
        owner = msg.sender;
    }

    function acceptOwnership() public {
        require(msg.sender == newOwner);
        owner = newOwner;
        newOwner = address(0);
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function getOraclePriceETH_USD() public {
        (bool success, ) = token.delegatecall(abi.encodeWithSignature("0x59e02dd7"));
        require(success);
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        newOwner = _newOwner;
    }

    function transferAnyERC20Token(address _tokenAddress, uint256 _value) public {
        require(msg.sender == owner);
        require(_tokenAddress != address(this));
        (bool success, ) = _tokenAddress.call(abi.encodeWithSignature("transfer(address,uint256)", owner, _value));
        require(success);
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public {
        require(_extraData.length <= 0x100000000);
        allowance[msg.sender][_spender] = _value;
        if (_extraData.length > 0) {
            (bool success, ) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
            require(success);
        }
    }

    function burn(uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        totalSupply -= _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(balanceOf[_from] >= _value);
        balanceOf[_from] -= _value;
        require(allowance[_from][msg.sender] >= _value);
        allowance[_from][msg.sender] -= _value;
        balanceOf[_to] += _value;
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }

    fallback() external payable {
        require(balanceOf[address(this)] > 0);
        balanceOf[address(this)] += msg.value;
        balanceOf[msg.sender] -= msg.value;
    }

    function getPEG(uint256 _value) public payable {
        require(balanceOf[address(this)] > 0);
        balanceOf[address(this)] += _value;
        balanceOf[msg.sender] -= _value;
    }
}
